import labelmake from "labelmake";
// import fs from 'fs';

export default async function createPdf({namefull, qrcode}) {
  // You can also use Uint8Array or ArrayBuffer as a basePdf
  // const basePdf = fs.readFileSync("path/to/your.pdf")
  // const basePdf = await fetch("path/to/your.pdf").then((res) => res.arrayBuffer());
  const template = {
	"basePdf": "data:application/pdf;base64,",
	"schemas": [
		{
			"name": {
				"type": "text",
				"position": {
					"x": 49.74,
					"y": 82.02
				},
				"width": 90.3,
				"height": 12.82,
				"alignment": "left",
				"fontSize": 12,
				"characterSpacing": 0,
				"lineHeight": 1
			},
			"qr": {
				"type": "qrcode",
				"position": {
					"x": 148.7,
					"y": 19.84
				},
				"width": 35,
				"height": 35
			}
		}
	]
};
  const inputs = [{name: namefull, qr: qrcode}];
  const pdf = await labelmake({ template, inputs });
  // Node
//   fs.writeFileSync('path/to/your.pdf', pdf);
  // Browser
  const blob = new Blob([pdf.buffer], { type: "application/pdf" });
  document.getElementById("iframe").src = URL.createObjectURL(blob);
// blob.save("demopdf.pdf")
};